import '../App.css';
import Expence from '../component/expenses/expenceDate'
function Item(prop){

return(
<div className='mainItem'>
    <Expence date= {prop.date}></Expence>
    <div className='itemDescription'>{prop.title}</div>
    <button className='submitBtn'>{prop.amount}</button>
</div>
);
}
export default Item;
